import React, { Component } from 'react'
import ReactDOM from 'react-dom'

export default class Register extends Component {
    componentDidMount(){ 
       ReactDOM.unmountComponentAtNode(document.getElementById("login"))
       this.render()
    }
  
    render() {
    return (
     <div id='register'>Register
      <br></br>
      注册用户名<input ref={c=>this.username=c}/>&nbsp;<br></br>
      注册密码&nbsp;&nbsp;<input ref={c=>this.password=c}/>
      <br></br>
      注册邮箱<input ref={c=>this.email=c}/>
      <br></br>
       <button>立即注册</button> 
       <button>取消</button> 
      
      </div>
    )
  }
}
